description:
With their exams over, best friends Malachy and Luke are out to have one hell of a summer. However, the arrival of Michelle, a captivating but troubled beauty, tests their friendship to the limit as she encourages the two boys to carry out increasingly dangerous and illegal stunts in the battle for her affections. As the competition between Malachy and Luke spirals out of control the future paths of all three are thrown into question...

